async function getLastLocaleWifi(){let t=await fetch("http://198.199.73.28:3000/positions/lasted");if(t.ok){printPointsInToSVG(await t.json())}else alert("HTTP-Error: "+t.status)}function printPointsInToSVG(t){var e=document.getElementById("People"),n=(600+5*t.x)%1e3,a=(350+3*t.y)%600;e.setAttribute("transform","translate("+n+" "+a+")")}setInterval(function(){getLastLocaleWifi()},5e3);